import './Projects.css'
import useTypewriter from 'typewriter-effect'

const Projects = () => {
  const {text} = useTypewriter({
    words: [" Developer "," Fullstack "," Freelancer "," Player "],
    loop: 0, 
    typeSpeed: 150,
    deleteSpeed: 50,
    delaySpeed: 1000
  });
  return (
    <div  className='d'>
      <Typewriter

       text={['Hello, world!', 'Welcome to Typewriter Effect!']}
        speed={150}
        typespeed={20}
        cursor="a"
        loop={true}
      />
    </div>
  )
}

export default Projects
